import { configureStore } from "@reduxjs/toolkit";
import model from "./SpecificationSlice";
import memory from "./SpecificationSlice";
import price from "./SpecificationSlice";
import diagonal from "./SpecificationSlice";

const store = configureStore({
    reducer: {
        model: model,
        memory: memory,
        price: price,
        diagonal: diagonal
    }
});

export default store;
